  \"2016-11-22T12:43:50.889895\",\n\t\"name\": \"solar-on-city-facilities\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"As part of AEu2019s Strategic Plan, Austin
  Energy selects high profile locations such as City buildings, libraries, and schools
  for solar projects as a way to increase public awareness and educate citizens about
  the advantages of solar power. A total of 58 City of Austin facilities have solar
  installations totaling more than 1,500 megawatts. While the majority of installations
  are relatively small in size, AE recently completed a 403-kW system at Austin Energy's
  new System Control Center which is the main control center for managing the Austin
  Energy electric system.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
